(1, 'Aspirin Protect 100mg 30 tablets', '  100  30 ', 'General', '', '- Medical description: The medication is an anti-inflammatory used in the treatment of acute coronary syndrome, prevention of cardiovascular diseases, and in the prevention of preeclampsia.\r\n\r\n- Indications and usage: It is used for the prevention of arterial thrombosis and strokes, in the treatment of unstable angina and acute myocardial infarction, and for the prevention of blood clotting after vascular surgery.\r\n\r\n- Dosage and administration: The dosage is determined according to the patient\'s needs and the type of condition, ranging from 100 mg to 300 mg daily for the prevention of blood clotting. The doctor decides the dosage and duration of use.\r\n\r\n- Side effects: Common side effects include stomach problems, asthma, digestive system issues, nausea, and vomiting, with the possibility of hypersensitivity reactions and gastrointestinal bleeding.\r\n\r\n- Warnings and precautions: Its use should be avoided in patients who are allergic to aspirin or have a history of peptic ulcer disease, and a doctor should be consulted before using it for children and teenagers.\r\n\r\n- Safety tips: It is important to adhere to the prescribed dosage and report any side effects to the doctor, and avoid its use in patients with asthma or children with chickenpox infection.', '-  :                      .\r\n\r\n-  :                           .\r\n\r\n-   :           100   300      .     . \r\n\r\n-  :                      .\r\n\r\n-  :                       .\r\n\r\n-  :                    .', 48.00, -5, 3, 'aspirin.jpg', NULL, '2024-12-06 14:24:17'),
(3, 'Brufen Cold 20 Film Coated Tablet', '  20  ', 'General', '', '- Medical Description: Proven Cold Tablets are used to alleviate symptoms of the common cold and flu, as well as nasal congestion, including pain, headache, fever, sore throat, and nasal congestion, and sinusitis. They contain 400 mg of ibuprofen and 60 mg of pseudoephedrine.\n\n- Composition: Each tablet contains 400 mg of ibuprofen and 60 mg of pseudoephedrine.\n\n- Usage: Proven Cold Tablets are indicated for relieving symptoms associated with the common cold and flu, as well as nasal congestion, sore throat, and sinusitis.\n\n- Dosage: For adults and children over 12 years old: take 1 tablet up to 3 times daily. Allow at least 4 hours between doses. Do not exceed 3 doses within 24 hours.\n\n- Precautions: Consult your doctor if symptoms worsen or persist for more than 10 days. Do not use for prolonged periods. Not recommended for children under 12 years old.', '-  :                          .    400     60   .\n\n- :     400    60  .\n\n- :                  .\n\n- :    12 :     3  .      4   .   3   24 .\n\n- :          10 .    .       12 .', 37.00, -230, NULL, 'brufenCold.jpg', '2024-05-06 19:29:06', '2024-12-06 14:43:37'),
(4, 'Celebrex 200mg 15 Capsules', ' 200  15 ', 'General', '', '- Medical Description: Celebrex 200mg capsules belong to the class of nonsteroidal anti-inflammatory drugs (NSAIDs) and are primarily used to alleviate pain and inflammation.\n\n- Composition: Each capsule contains 200mg of Celecoxib.\n\n- Usage: Celebrex is utilized as an analgesic and anti-inflammatory agent in various conditions such as arthritis, ankylosing spondylitis, and menstrual pain.\n\n- Dosage: The typical adult dosage for pain is 400 mg initially, followed by 200 mg if necessary on the first day. Subsequently, take 200 mg twice daily as needed. If unable to swallow the capsule whole, it can be opened and the medicine sprinkled into food.\n\n- Precautions: Patients with cardiovascular disease or those at risk should seek advice from their physician before using Celebrex.', '-  :    200        (NSAIDs)       .\n\n- :     200   .\n\n- :                 .\n\n- :       400     200       .    200     .             .\n\n- :                    .', 153.00, -2, NULL, 'celebrex.jpg', '2024-05-06 19:29:06', '2025-05-15 03:16:53'),
(5, 'Recoxibright 90mg 30 Coated Tablets', ' 90  30 \n ', 'General', '', '- Medical Description: These tablets are anti-inflammatory and pain-relieving medications containing 90 mg of Etoricoxib. They work by reducing pain and inflammation in the joints and muscles, commonly associated with conditions such as osteoarthritis, rheumatoid arthritis, ankylosing spondylitis, and gout. Additionally, they are utilized for short-term treatment of moderate pain following dental surgery.\n\n- Composition: Each tablet contains 90 mg of Etoricoxib.\n\n- Usage: These tablets are indicated for reducing pain and inflammation in various musculoskeletal conditions such as osteoarthritis, rheumatoid arthritis, ankylosing spondylitis, and gout. They are also suitable for short-term treatment of moderate pain after dental surgery.\n\n- Dosage: The recommended dosage is once daily or as advised by the physician.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '-  :           90   .                        .             .\n\n- :     90   .\n\n- :                      .           .\n\n- :           .\n\n- :               .                    .', 204.00, 17, NULL, 'recoxibright.jpg', '2024-05-06 19:29:06', '2025-05-13 14:26:49'),
(6, 'Doliprane (Novaldo) 1000mg 15 Tablet', '  ', 'General', '', '- Medical Description: The active ingredient in this medication is Paracetamol, which is used for pain management and fever reduction.\n\n- Composition: Each dose contains Paracetamol.\n\n- Usage: It is used for the management of mild to moderate pain in patients aged 2 years and older, and for the management of moderate to severe pain when combined with opioid analgesia in patients aged 2 years and older. It is also utilized orally or rectally for the temporary relief of minor aches, pains, and headaches. Additionally, it is used to temporarily reduce fever.\n\n- Dosage: Dosage varies depending on the severity of pain and the age of the patient. Consult with a healthcare professional for appropriate dosing instructions.\n\n- Precautions: Patients should follow dosing instructions carefully and avoid exceeding the recommended dosage to prevent potential adverse effects. Consult a healthcare provider for advice on appropriate usage, especially in pediatric patients and those with underlying medical conditions.', '-  :             .\n\n- :     .\n\n- :                                   .               .         .\n\n- :       .         .\n\n- :                .                    .', 28.50, 96, NULL, 'doliprane.jpg', '2024-05-06 19:29:06', '2024-12-07 23:59:06'),
(7, 'Burfen 600mg 30 Tablets', ' 600  30 ', 'General', '', '- Medical Description: Brufen 600mg tablets are utilized for pain and fever relief.\n\n- Composition: Each tablet contains Ibuprofen 600mg as the active ingredient.\n\n- Usage: They are indicated for the relief of various conditions including headache, fever, period pain, toothache, colds, and mild arthritis.\n\n- Dosage: The recommended dosage is 1200-1800 mg (2-3 tablets) daily, divided into multiple doses, or as prescribed by a physician.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '-  :    600    .\n\n- :      600   .\n\n- :                    .\n\n- :     1200-1800  (2-3 )         .\n\n- :               .                    .', 66.00, 5, NULL, 'burfen.jpg', '2024-05-06 19:29:06', '2025-05-13 14:26:49'),
(8, 'Zyrtec 10mg 20 Tablets', ' 10  20 ', 'General', '', '- Medical Description: These tablets are used for the management of allergic conditions.\n\n- Composition: Each tablet contains 10 mg of Cetirizine.\n\n- Usage: They act as an antihistamine to treat cold or allergy symptoms including sneezing, itching, watery eyes, and runny nose. Additionally, they relieve symptoms associated with seasonal allergic rhinitis and chronic urticaria.\n\n- Dosage: The recommended dosage is one tablet orally once a day or as directed by a physician.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '-  :      .\n\n- :     10   .\n\n- :                 .             .\n\n- :                .\n\n- :               .                    .', 65.00, 46, NULL, 'zyrtec.jpg', '2024-05-06 19:29:06', '2025-05-15 03:04:54'),
(9, 'Histazine-1 10mg 20 Tablet', '-1 10  - 20 ', 'General', '', '- Medical Description:These tablets contain the active ingredient Cetirizine and are used systemically for various conditions.\n\n- Composition: Each tablet contains Cetirizine.\n\n- Usage: They are utilized for the temporary relief of symptoms associated with upper respiratory allergies, such as sneezing and nasal congestion. Additionally, they relieve itching due to urticaria (hives) and treat ocular itching associated with allergic conjunctivitis.\n\n- Dosage: The recommended dosage varies depending on the specific condition being treated and the patient\'s age. Generally, for upper respiratory allergies and urticaria, the typical adult dosage is 10 mg orally once daily. For children, the dosage may be adjusted based on their age and weight. For allergic conjunctivitis, the dosage may vary depending on the formulation (e.g., oral vs. ophthalmic). It\'s important to follow the dosage instructions provided by the physician or as indicated on the medication label.\n\n- Precautions: Patients should adhere to the prescribed dosage and consult their physician for any concerns or adjustments. It\'s important to follow medical advice regarding the use of these tablets, especially in cases of prolonged usage or underlying health conditions.', '-  :            .\n\n- :     .\n\n- :               .                .\n\n- :            .             10       .         .           (       ).               .\n\n- :               .                    .', 43.00, 65, NULL, 'histazine.jpg', '2024-05-06 19:29:06', '2025-05-13 18:18:29'),
(10, 'Augmentin 1gm 14 Tablets', ' 1  14 ', 'General', '', '- Medical Description: Augmentin 1gm tablets are broad-spectrum antibiotics used to treat a variety of bacterial infections.\n\n- Composition: Each tablet contains 875 mg of Amoxicillin and 125 mg of Clavulanic acid, totaling 1 g.\n\n- Usage: They are indicated for the treatment of bacterial infections such as sinusitis, pneumonia, ear infections, bronchitis, urinary tract infections, and skin infections.\n\n- Dosage: The usual dosage is one tablet every 12 hours or as directed by a physician.\n\n- Usage: It is recommended to take the tablet with food to reduce the risk of gastrointestinal discomfort.\n\n- Precautions: Patients should complete the full course of medication as prescribed by their physician, even if symptoms improve before the course is completed. It\'s important to follow medical advice regarding the use of this antibiotic, especially in cases of known allergies or other underlying health conditions.', '-  :  1              .\n\n- :     875    125     1 .\n\n- :                    .\n\n- :       12     .\n\n- :            .\n\n- :                 .                      .', 131.00, 83, NULL, 'augmentin.jpg', '2024-05-06 19:29:06', '2025-05-15 02:31:29'),
(11, 'Hibiotic 1gm 16 Tablets', '  1  16 ', 'General', '', '- Medical Description: Active Ingredient Amoxicillin 875mg Clavulanic Acid 125mg\r\n\r\n- Usage: Broad Spectrum Antibiotic\r\n\r\n- Mode Of Action: Cell Wall Inhibitor Antibacterial Agent\r\n\r\n- Dose: For Adults: One 1000 mg Tablet Every 12 Hours\r\n\r\n- Special Notes: Many Antibiotics Can Cause Diarrhea. If Diarrhea Is Severe Or Lasts More Than 2 Or 3 Days, Call Your Doctor. Many Antibiotics Can Hypersensitivity Reactions. If There Is Any Hypersensitivity Reaction Call Your Doctor. Follow Your Doctor\'s Instructions About The Amount To Use And The Days Of Treatment.', '-  :    875    125 \r\n\r\n- :    \r\n\r\n-  :      \r\n\r\n- : :   1000   12 \r\n\r\n-  :        .              .        .         .          .', 120.00, 0, NULL, 'hibiotic1gm.jpg', NULL, NULL),
(12, 'Megamox 1gm 14 Tablets', ' 1  14 ', 'General', '', '- Medical Description: This medication contains the active ingredients Amoxicillin (875mg) and Clavulanic Acid (125mg).\r\n\r\n- Usage: It is classified as a broad-spectrum antibiotic.\r\n\r\n- Mode of Action: The medication acts as a cell wall inhibitor antibacterial agent.\r\n\r\n- Dose: For adults, the recommended dosage is one 1000 mg tablet every 12 hours.\r\n\r\n- Special Notes: Many antibiotics can cause diarrhea. If diarrhea is severe or lasts more than 2 or 3 days, call your doctor. Many antibiotics can cause hypersensitivity reactions. If there is any hypersensitivity reaction, call your doctor. Follow your doctor\'s instructions about the amount to use and the duration of treatment.', '-  :        (875 )   (125 ).\r\n\r\n- :     .\r\n\r\n-  :        .\r\n\r\n- : :       1000   12 .\r\n\r\n-  :        .              .          .         .          .', 94.00, -2, NULL, 'megamox.jpg', NULL, '2024-08-25 11:50:33'),
(13, 'Megamox 625gm 14 Tablets', ' 625  14 ', 'General', '', '- Medical Description: This medication contains the active ingredients Amoxicillin (500mg) and Clavulanic Acid (125mg).\r\n\r\n- Usage: It is classified as a broad-spectrum antibiotic.\r\n\r\n- Mode of Action: The medication acts as a cell wall inhibitor antibacterial agent.\r\n\r\n- Dose: For adults, the recommended dosage is one 625 mg tablet every 12 hours.\r\n\r\n- Special Notes: Many antibiotics can cause diarrhea. If diarrhea is severe or lasts more than 2 or 3 days, call your doctor. Many antibiotics can cause hypersensitivity reactions. If there is any hypersensitivity reaction, call your doctor. Follow your doctor\'s instructions about the amount to use and the duration of treatment.', '-  :        (500 )   (125 ).\r\n\r\n- :     .\r\n\r\n-  :        .\r\n\r\n- : :       625   12 .\r\n\r\n-  :        .              .          .         .          .', 60.00, 9, NULL, 'megamox625gm.jpg', NULL, '2025-05-15 02:31:29'),
(14, 'Entresto 50 mg 28 Tablets', ' 50  28 ', 'Heart', '', '- Medical Description: These tablets are used to treat heart muscle weakness.\r\n\r\n- Composition: Each tablet contains 24 mg of Sacubitril and 26 mg of Valsartan.\r\n\r\n- Usage: They are indicated for heart muscle problems.\r\n\r\n- Dosage: The usual dosage is twice daily with a dose determined by the prescribing physician.\r\n\r\n- Packaging: Each pack contains 28 tablets.', '-  :        .\r\n\r\n- :     24    26  .\r\n\r\n- :     .\r\n\r\n- :            .\r\n\r\n-  :     28 .', 1369.00, -156, NULL, 'entresto.jpg', NULL, '2025-01-22 15:11:49'),
(15, 'Flixonase nasal spray', '  ', 'Nose', '', '- Medical Description: This nasal spray is used to treat sinusitis.\r\n\r\n- Composition: It contains a concentration of 0.05% Fluticasone.\r\n\r\n- Usage: It is utilized for the treatment of chronic or seasonal sinusitis.\r\n\r\n- Dosage: The usual dosage is 2 sprays into each nostril once daily or as prescribed by the treating physician.\r\n\r\n- Packaging: Each pack contains 120 sprays.', '-  :        .\r\n\r\n- :    0.05% .\r\n\r\n- :        .\r\n\r\n- :                .\r\n\r\n-  :     120 .', 90.00, 115, NULL, 'flixonase.jpg', NULL, NULL),
(16, 'Nasacort Aqua 55 micro 120 dose spray', '  55  120  ', 'Nose', '', '- Medical Description: This nasal spray is used to treat seasonal and perennial nasal allergies.\r\n\r\n- Composition: Each spray contains 55 micrograms of Triamcinolone.\r\n\r\n- Usage: It is typically administered as two sprays into each nostril once daily or as directed by the treating physician.\r\n\r\n- Precaution before First Use: Before the initial use of the device, it is necessary to shake the device well and spray 5 times into the air away from the face.\r\n\r\n- Packaging: Each pack contains 120 sprays (equivalent to 30 days of use).', '-  :         .\r\n\r\n- :     55  .\r\n\r\n- :                .\r\n\r\n-    :           5      .\r\n\r\n-  :     120  (  30   ).', 100.00, 12, 17, 'nasacort.jpg', NULL, '2025-05-17 00:29:36'),
(17, 'Adol Sinus - 24 Caplets', '  24 ', 'Nose', '', '- Active Ingredients: It contains a combination of Paracetamol and Pseudoephedrine.\r\n\r\n- Usage: It is used to relieve symptoms of nasal congestion, fever, and accompanying headaches associated with respiratory conditions such as sinusitis, colds, and nasal allergies.\r\n\r\n- Dosage for Adults: Two tablets every 6 hours, up to a maximum of 4 times daily.\r\n\r\n- Precautions: Consult your doctor before use if you have high blood pressure, heart disease, prostate enlargement, glaucoma, or liver disease.', '-  :      .\r\n\r\n- :                   .\r\n\r\n-  :   6    4  .\r\n\r\n- :                      .', 24.00, 5, NULL, 'adol.jpg', NULL, '2024-08-24 23:19:20'),
(18, 'Clerest 14 capsules', ' 14 ', 'Nose', '', '- Medical Description: Capsules for Treating Nasal Allergies and Congestion.\n\n- Composition: Each capsule contains Cetirizine and Pseudoephedrine.\n\n- Usual Dosage: Take one capsule twice daily or as prescribed by the treating physician.\n\n- Packaging: Each pack contains 14 capsules.', '-  :     :\r\n\r\n- :      .\r\n\r\n-  :          .\r\n\r\n-  :     14 .', 27.00, 21, NULL, 'clerest.jpg', NULL, '2024-12-04 17:47:04'),
(19, 'Decanset SR 20 tablets', '   20 ', 'Nose', '', '- Medical Description: Extended-Release Tablets for Treating Nasal Congestion and Sinus Infections:\r\n\r\n- Composition: Each tablet contains 5 mg of Cetirizine and 120 mg of Pseudoephedrine.\r\n\r\n- Usage: It is used for nasal congestion and sinus infections.\r\n\r\n- Usual Dosage: Take one tablet every 12 hours, to be swallowed whole and not chewed.\r\n\r\n- Precautions: Use with caution in elderly individuals and those with certain chronic conditions such as elevated eye pressure and prostate enlargement.', '-  :         :\r\n\r\n- :     5    120  .\r\n\r\n- :        .\r\n\r\n-  :    12      .\r\n\r\n- :                 .', 26.00, 5, NULL, 'decanset.jpg', NULL, NULL),
(20, 'Dermovate cream 25 gm', ' 25  ', 'Skin Diseases', ' ', '- Medical Description: Strong Anti-Inflammatory Cream for Treating Severe Skin Inflammation such as Eczema:\r\n\r\n- Composition: It contains 0.05% Clobetasol Propionate.\r\n\r\n- Usage: It is used for conditions like psoriasis, erythroderma, and other severe skin inflammations.\r\n\r\n- Frequency of Use: Apply once or twice daily as directed by the treating physician.\r\n\r\n- Precautions: It is not recommended for use in children under one year old.\r\n\r\n- Packaging: Each pack contains 25 grams.', '-  :          :\r\n\r\n- :   0.05%  .\r\n\r\n- :            .\r\n\r\n-  :         .\r\n\r\n- :        .\r\n\r\n-  :     25 .', 27.00, -373, 21, 'dermovate.jpg', NULL, '2025-05-14 00:10:41'),
(21, 'Elica-m Cream 30 gm', '  30  ', 'Skin Diseases', ' ', '- Medical Description: Cream for Skin Inflammation Associated with Fungal Infections:\r\n\r\n- Composition: It contains both Mometasone and Miconazole.\r\n\r\n- Usage: Apply a thin layer once or twice daily or as directed by the physician.\r\n\r\n- Packaging: Each pack contains 30 grams.', '-  :       :\r\n\r\n- :      .\r\n\r\n- :           .\r\n\r\n-  :     30 .', 34.00, -85, NULL, 'elica.jpg', NULL, '2025-05-17 06:04:17'),
(22, 'Betaderm cream 15 gm', ' 15  ', 'Skin Diseases', ' ', '- Medical Description: Yata Derm Cream Anti-Inflammatory\r\n\r\n- Composition: It contains the active ingredient Betamethasone.\r\n\r\n- Usage: It is a potent topical corticosteroid for adults and children over one year old, used to relieve inflammation and itching in conditions such as skin allergies, psoriasis, and insect bites.\r\n\r\n- Usage Method: Apply a thin layer covering the affected area, gently massaging once to twice daily or as directed by the physician.\r\n\r\n- Precautions: Yata Derm should not be used to treat acne, itching around the genital organs, or itching around the mouth.\r\n\r\n- Storage: Store at temperatures not exceeding 30 degrees Celsius.', '-  :     \r\n\r\n- :     .\r\n\r\n- :                        .\r\n\r\n-  :                .\r\n\r\n- :                 .\r\n\r\n- :        30  .', 11.50, -57, NULL, 'betaderm.jpg', NULL, '2024-12-06 15:21:20'),
