(26, 'Macro Panthenol Cream 50 gm', '  50  ', 'Body Care', '  ', '- Medical Description: Topical Cream used as a Moisturizer, Soothing Agent, and Anti-Irritant:\r\n\r\n- Composition: It contains Panthenol, Glycerin, and Paraffin Oil (50 grams).\r\n\r\n- Usage: This cream acts as a moisturizer while soothing and calming irritated skin. It also prevents skin dryness.\r\n\r\n- Dosage: Apply once or twice daily.', '-  :       :\r\n\r\n- :       (50 ).\r\n\r\n- :         .     .\r\n\r\n- :     .', 45.00, -80, NULL, 'marcopanthenol.jpg', NULL, '2025-04-08 20:48:23'),
