(30, 'CeraVe S.A. 473 ml', '    473 ', 'Skin Care', ' ', '- S.A. Smoothing Cleanser is a facial cleanser designed for normal, dry, and rough skin with 437ml of Salicylic Acid.\r\n- Effectively cleanses the skin to remove dirt.\r\n- Salicylic acid exfoliates the skin to enhance its smoothness and evenness.\r\n- Enriched with antioxidant Vitamin D.\r\n- Ceramides help repair the skin\'s natural barrier and maintain it.\r\n- Hyaluronic acid preserves natural moisture in the skin layers.\r\n- Niacinamide helps soothe the skin.\r\n- Fragrance-free, non-allergenic, and does not cause blackheads.\r\n- Developed in collaboration with dermatologists.', '- S. A. Smoothing Cleanser          437    .\r\n-      .\r\n-         .\r\n-     .\r\n-         .\r\n-         .\r\n-     .\r\n-          .\r\n-      .', 749.00, 13, NULL, 'cerave.jpg', NULL, '2024-12-01 20:43:44'),
(31, 'Nervalta 60 mg 10 capsules', '  60  10 ', 'Anti-Depressant', ' ', '- Medical Description: Slow-release capsules containing Duloxetine Hydrochloride 60mg.\r\n\r\n- Composition: Each capsule contains 60mg of Duloxetine Hydrochloride.\r\n\r\n- Usage: Indicated for:\r\n - Major depressive disorder.\r\n - Generalized anxiety disorder.\r\n - Diabetic peripheral neuropathic pain.\r\n - Fibromyalgia.\r\n - Chronic musculoskeletal pain.\r\n\r\n- Dosage: As prescribed by the treating physician. The capsules should be swallowed whole and should not be chewed or crushed. The capsule should not be opened and its contents should not be sprinkled on food or mixed with liquids.\r\n\r\n- Precautions:\r\n- Contraindicated in patients taking monoamine oxidase inhibitors (MAOIs) and those with narrow-angle glaucoma.\r\n- Clinical worsening and suicide risk.\r\n- Hepatotoxicity.\r\n- Orthostatic hypotension and syncope.\r\n- Serotonin syndrome or NMS-like reactions.\r\n- Abnormal bleeding.\r\n- Mania/hypomania.\r\n- Seizures.\r\n- Hyponatremia.\r\n- Urinary hesitancy and retention.', '-  :        60 .\r\n\r\n- :     60    .\r\n\r\n- :  :\r\n -   .\r\n -   .\r\n -       .\r\n - .\r\n -    .\r\n\r\n- :    .         .             .\r\n\r\n- :\r\n-          (MAOIs)      .\r\n-    .\r\n-  .\r\n-     .\r\n-      NMS.\r\n-   .\r\n- / .\r\n- .\r\n-   .\r\n-   .', 78.00, 0, NULL, 'nervalta.jpg', NULL, NULL),
